import * as React from "react";
import {Box, Typography} from "@mui/material";

export default function VenuesPage() {
    return (
        <>
            {/* First Box */}
            <Box
                sx={{
                    width: "100%",
                    height: "20vh",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    backgroundColor: "#ffffff",
                }}
            >
                <Typography
                    variant="h3"
                    sx={{
                        fontWeight: "bold",
                        color: "#333333",  // Dark color for contrast
                        textAlign: "center",
                        fontSize: "3rem",  // Customize the size if needed
                    }}
                >
                    Venues
                </Typography>
            </Box>

            {/* Second Box */}
            <Box
                sx={{
                    width: "100%",
                    height: "20vh",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    backgroundColor: "#f0f0f0",  // Different background color
                }}
            >
                <Typography
                    variant="h4"
                    sx={{
                        fontWeight: "normal",
                        color: "#555555",  // Lighter color
                        textAlign: "center",
                        fontSize: "2rem",  // Adjust the size as needed
                    }}
                >
                    Additional Content
                </Typography>
            </Box>
        </>
    );
}
